import React from 'react';
import Link from 'next/link'

const Navegacion = () => {
    return ( 
        <nav className = "d-flex flex-row bd-highlight mb-3 justify-content-start">
            <Link href = "/index" className="p-2 bd-highlight"><a>Index </a></Link>
            <Link href = "/Medicinales" clclassName="p-2 bd-highlight"><a>Medicinales</a></Link>
            <Link href = "/Alimentos" className="p-2 bd-highlight"><a>Alimentos</a></Link>
            <Link href = "/Decorativas" className="p-2 bd-highlight"><a>Decorativas</a></Link>
        </nav>
     );
}

 
export default Navegacion;
